import axios from 'axios'

const CATEGORY = 'test'
const GROCERY_API_URL = 'http://localhost:9000'
const CATEGORY_API_URL = `${GROCERY_API_URL}/instructors/${CATEGORY}`

class GroceryDataService {

    retrieveAllGroceries(name) {
        //console.log('executed service')
        return axios.get(`${CATEGORY_API_URL}/groceries`);
    }

    retrieveGrocery(name, id) {
        //console.log('executed service')
        return axios.get(`${CATEGORY_API_URL}/groceries/${id}`);
    }

    deleteGrocery(name, id) {
        //console.log('executed service')
        return axios.delete(`${CATEGORY_API_URL}/groceries/${id}`);
    }

    updateGrocery(name, id, grocery) {
        //console.log('executed service')
        return axios.put(`${CATEGORY_API_URL}/groceries/${id}`, grocery);
    }

    create(name, grocery) {
        //console.log('executed service')
        return axios.post(`${CATEGORY_API_URL}/groceries/`, grocery);
    }
}

export default new GroceryDataService()
